An incredibly inspirational afternoon with a powerhouse of women around one table. 😍 Thank you for leading by example in the way you empower women and for making this spectacular afternoon possible @cindy_nell. You inspire me to use my voice, ask for what I want and to make the world around me a better place. 🙏🏻🤗

I am usually the one doing motivational speaking, but it was an HONOUR to listen to so many other women's inspiring testimonies and life hacks yesterday. 🥰 The advice I shared: Visualise the type of life you want to live and make deliberate choices every day to move closer to that goal. Don't wait for others to make things happen for you. That responsibility lies within yourself. Give yourself permission to be bold and confident about who you are and what you want. 😉🥳

Cheers to Women's Month that is around the corner! 🥂💚

